import React, { useState } from 'react'

export default function Todos(key, todo) {
    const [todos, SetTodos] = useState(['dsd'])
    SetTodos([
        ...todos,
       {key: key, todo: todo}
      ]);
  return (
    <div>

        <ul>
        {todos.map(t => (
          <li key={t.key}>{t.key} {t.todo}</li>
        ))}
      </ul>
    </div>
  )
}
